    false,nt"url": null,nt"notes": "Observational reports of daily precipitation
    (1200 UTC to 1200 UTC) are made by members of the NWS Automated Surface Observing
    Systems (ASOS) network; NWS Cooperative Observer Network (COOP); the Hydrometeorological
    Automated Data System (HADS) network; the SNOTEL (SNOwpack TELemetry) network; and
    the Integrated Flood Observing and Warning System (IFLOWS) network. Reports from
    approximately 9,000 stations across the US including Alaska, Hawaii, and Puerto
    Rico are sent on a daily basis to the Climate Prediction Center (CPC). During the
    winter season when the type of precipitation is frozen, the amount reported is the
    liquid equivalent. CPC processes these reports once per day. All reports for the
    same day are put into an ASCII text file whose name includes the date of observation.
    These data are used by CPC in its role of supporting the Joint Agricultural Weather
    Facility (JAWF).",nt"license_title": null,nt"extras": [{ntt"key":
